🎨 ¡Embárcate en un viaje visual en Festigeek con nuestros talentosos ilustradores! 🌟🖌️

En Festigeek, celebramos la creatividad y damos la bienvenida a ilustradores increíbles que te llevarán a mundos imaginarios con sus obras maestras. 🚀✨

👨‍🎨 Descubre el Arte Geek:

@spacee.katt
@ilustra.dit
@akira.dibuja
@_achy
@gorrionblue
@arichy_art
@_miss_galassia_
@oni_giri._

🌈 Inspírate y Adquiere Arte Único:
Desde fan art cautivador hasta ilustraciones originales, cada obra es una ventana a la imaginación y la pasión geek.

🗓️ Fecha: 2 de diciembre, desde las 09:00 hrs.

📍 Lugar: UTFSM, Campus San Joaquín. Vicuña Mackenna 3939, Santiago.

¡Explora, conversa con los artistas y lleva a casa una pieza única que habla directamente a tu alma geek! 🖼️🚀

#IlustradoresGeek #Festigeek #ArteGeek #EventoCreativo #ExploraElMundoDeLaIlustración

¡Te esperamos en Festigeek para sumergirte en el fascinante mundo de la ilustración geek! 🎨✨
